        public async void TipoCambio()
        {
            string apiUrl = "https://bigcluboutlet.com/venta/api/";
            try
            {
                using (HttpClient client = new HttpClient())
                {
                    HttpResponseMessage response = await client.GetAsync(apiUrl);
                    response.EnsureSuccessStatusCode(); // Verifica que la respuesta sea exitosa

                    string responseBody = await response.Content.ReadAsStringAsync();

                    // Deserializa la respuesta JSON en un objeto dinámico para manejar ambos casos
                    dynamic jsonResponse = JsonConvert.DeserializeObject<dynamic>(responseBody);

                    // Verifica si la respuesta contiene el tipo de cambio
                    if (jsonResponse.ContainsKey("tiposCambio"))
                    {
                        var tiposCambio = jsonResponse.tiposCambio.ToObject<List<string>>();
                        if (tiposCambio.Count > 0)
                        {
                            // Aquí se almacena el tipo de cambio. Puedes guardarlo en una variable, base de datos, etc.
                            string tipoCambio = tiposCambio[0];
                            lblDolar.Text = tipoCambio;
                        }
                    }

                }
            }
            catch (HttpRequestException httpRequestException)
            {
                MessageBox.Show("Error al obtener los datos de la API: " + httpRequestException.Message, "Error", MessageBoxButtons.OK, MessageBoxIcon.Error);
            }
            catch (Exception ex)
            {
                MessageBox.Show("Error al procesar los datos: " + ex.Message, "Error", MessageBoxButtons.OK, MessageBoxIcon.Error);
            }

        }
