        private void calcularcambio()
        {
            // Verificar si no hay productos en la venta
            if (txttotalpagar.Text.Trim() == "")
            {
                MessageBox.Show("No existen productos en la venta", "Mensaje", MessageBoxButtons.OK, MessageBoxIcon.Exclamation);
                return;
            }

            decimal total = Convert.ToDecimal(txttotalpagar.Text); // Total a pagar

            // Si el cliente no ha indicado cuánto paga en pesos, lo inicializamos en 0
            decimal pagoPesos = string.IsNullOrEmpty(txtpagocon.Text.Trim()) ? 0 : Convert.ToDecimal(txtpagocon.Text.Trim());

            // Si el cliente no ha indicado cuánto paga en dólares, lo inicializamos en 0
            decimal pagoDolares = string.IsNullOrEmpty(txtPagoDolar.Text.Trim()) ? 0 : Convert.ToDecimal(txtPagoDolar.Text.Trim());

            // Convertir dólares a pesos usando el tipo de cambio
            decimal tipoCambio = Convert.ToDecimal(lblDolar.Text.Trim());
            decimal pagoEnPesosDeDolares = pagoDolares * tipoCambio;

            // Calcular el total pagado en pesos (pesos + dólares convertidos a pesos)
            totalPagado = pagoPesos + pagoEnPesosDeDolares;

            // Si lo que el cliente paga es menor que el total, no hay cambio
            if (totalPagado < total)
            {
                txtcambio.Text = "0.00";
            }
            else
            {
                // Calcular el cambio
                decimal cambio = totalPagado - total;
                txtcambio.Text = cambio.ToString("0.00");
            }
        }


