        public async Task EnviarVentaApiAsync(Venta oVenta, string nombreSucursal)
        {
            try
            {
                // Serializar el objeto a JSON
                string jsonVenta = JsonConvert.SerializeObject(new
                {
                    NombreSucursal = nombreSucursal, // Esto puede ser dinámico según tus datos
                    Contrasena = "202020",          // Puedes agregar la lógica para la contraseña
                    OtrosDatos = oVenta
                });

                // URL de la API
                string urlApi = "https://software.bigcluboutlet.com/venta/api/obtenerVenta.php?";

                // Configurar HttpClient
                using (HttpClient client = new HttpClient())
                {
                    // Preparar el contenido de la solicitud con el JSON
                    StringContent content = new StringContent(jsonVenta, Encoding.UTF8, "application/json");

                    // Enviar la solicitud POST
                    HttpResponseMessage response = await client.PostAsync(urlApi, content);

                    // Leer la respuesta
                    string responseBody = await response.Content.ReadAsStringAsync();

                    // Validar la respuesta
                    if (response.IsSuccessStatusCode)
                    {
                        Console.WriteLine("Venta registrada correctamente: " + responseBody);
                    }
                    else
                    {
                        Console.WriteLine("Error al registrar la venta: " + responseBody);
                    }
                }
            }
            catch (Exception ex)
            {
                // Manejar cualquier error
                Console.WriteLine("Error: " + ex.Message);
            }
        }

