        private void printDocument_PrintPage(object sender, PrintPageEventArgs e)
        {
            float yPos = 20;

            // Convertir la imagen de bytes a Image
            using (MemoryStream ms = new MemoryStream(imageBytes))
            {
                Image logo = Image.FromStream(ms);

                // Tamaño del logo en centímetros
                float logoWidthCm = 5f;
                float logoHeightCm = 5f;

                // Conversión de cm a píxeles (96 DPI)
                float dpi = 96f;
                float logoWidthPx = logoWidthCm * dpi / 2.54f;
                float logoHeightPx = logoHeightCm * dpi / 2.54f;

                // Redimensionar el logo
                Image resizedLogo = new Bitmap(logo, (int)logoWidthPx, (int)logoHeightPx);

                // Determinar posición y centrar el logo
                float xPosLogo = (e.PageSettings.PrintableArea.Width - resizedLogo.Width) / 2;
