                // Dibujar el precio en una línea y la cantidad en la siguiente
                e.Graphics.DrawString($"Precio: {precio}", fuenteContenido, Brushes.Black, 10, yPos);
                yPos += 15; // Aumentar el espacio para la siguiente línea
                e.Graphics.DrawString($"Cantidad: {cantidad}  Subtotal: {subtotal}", fuenteContenido, Brushes.Black, 10, yPos);
                yPos += 30; // Espacio entre productos
            }


            // Separador
            e.Graphics.DrawString("====================================", fuenteContenido, Brushes.Black, 10, yPos);
            yPos += 20;

            // Totales
            e.Graphics.DrawString($"Total a pagar: {txttotalpagar.Text} MXN", fuenteContenido, Brushes.Black, 10, yPos);
            yPos += 20;

            // Mostrar pagos en pesos y en dólares
            e.Graphics.DrawString($"Pagado en pesos: {txtpagocon.Text} MXN", fuenteContenido, Brushes.Black, 10, yPos);
            yPos += 20;

            // Mostrar el pago en dólares y la conversión
            decimal pagoDolares = string.IsNullOrEmpty(txtPagoDolar.Text.Trim()) ? 0 : Convert.ToDecimal(txtPagoDolar.Text.Trim());
            decimal tipoCambio = Convert.ToDecimal(lblDolar.Text.Trim());
            decimal pagoEnPesosDeDolares = pagoDolares * tipoCambio;

            e.Graphics.DrawString($"Pagado en dólares: {pagoDolares} USD (equivale a {pagoEnPesosDeDolares.ToString("0.00")} MXN)", fuenteContenido, Brushes.Black, 10, yPos);
            yPos += 20;

            // Mostrar el cambio
            e.Graphics.DrawString($"Cambio: {txtcambio.Text} MXN", fuenteContenido, Brushes.Black, 10, yPos);
            yPos += 30;

            // Garantías (fuente más pequeña)
            string textoGarantia = "Las garantías aplican solo si el producto no está golpeado o con daños externos.\n" +
                                   "Si tiene alguna queja o sugerencia, escribanos al WhatsApp +52 663 101 4717. No hay devolucion en efectivo";
            RectangleF areaGarantia = new RectangleF(10, yPos, anchoPagina - 20, 100);
            e.Graphics.DrawString(textoGarantia, fuenteGarantia, Brushes.Black, areaGarantia);
            yPos += areaGarantia.Height + 10;

            // Notas del cliente
            string notas = txtNotas.Text;
            RectangleF areaNotas = new RectangleF(10, yPos, anchoPagina - 20, 100);
            e.Graphics.DrawString($"Notas: {notas}", fuenteContenido, Brushes.Black, areaNotas);
            yPos += areaNotas.Height + 10;

            // Mensaje final y folio
            float espacioRestante = e.PageSettings.PrintableArea.Height - yPos; // Espacio restante en la página

            // Verificar si hay suficiente espacio para el mensaje final
            if (espacioRestante > 60) // Ajusta este valor según tus necesidades
            {
                e.Graphics.DrawString("Visita bigcluboutlet.com", fuenteContenido, Brushes.Black, 10, yPos);
                yPos += 20;
                e.Graphics.DrawString($"Folio: {numeroDocumento}", fuenteContenido, Brushes.Black, 10, yPos);
                yPos += 30;

                // Agradecimiento final (centrado)
                e.Graphics.DrawString("Gracias por su compra", fuenteTitulo, Brushes.Black, new RectangleF(0, yPos, anchoPagina, 30), formatoCentro);
            }
            else
            {
                // Si no hay suficiente espacio, podrías ajustar el mensaje o omitir algunas partes
                e.Graphics.DrawString("Gracias por su compra", fuenteTitulo, Brushes.Black, new RectangleF(0, yPos, anchoPagina, 30), formatoCentro);
            }
        }




