        private decimal precioOriginal;

        private void cbPorcentaje_SelectedIndexChanged(object sender, EventArgs e)
        {
            // Si la variable precioOriginal aún no tiene valor, inicialízala con el valor original del precio total
            if (precioOriginal == 0)
            {
                precioOriginal = decimal.Parse(txttotalpagar.Text);
            }

            string seleccion = cbPorcentaje.Text;

            // Verificar si el valor es un número (descuento en porcentaje)
            if (decimal.TryParse(seleccion, out decimal descuentoPorcentaje))
            {
                // Aplica el descuento como porcentaje
                decimal descuentoDecimal = descuentoPorcentaje / 100;

                // Calcula el precio con el descuento aplicado
                decimal precioConDescuento = precioOriginal - (precioOriginal * descuentoDecimal);

                // Actualiza el TextBox con el precio final
                txttotalpagar.Text = precioConDescuento.ToString("0.00");
            }
            else if (seleccion.ToLower() == "Martes y jueves")
            {
                // Aplica el descuento como porcentaje
                decimal descuentoDecimal = 5 / 100;

                // Calcula el precio con el descuento aplicado
                decimal precioConDescuento = precioOriginal - (precioOriginal * descuentoDecimal);

                // Actualiza el TextBox con el precio final
                txttotalpagar.Text = precioConDescuento.ToString("0.00");
            }
            else if (seleccion.ToLower() == "no")
