                MessageBox.Show("Entrada no válida. Selecciona un número o 'Sí' o 'No'.");
            }
        }
        //usarpuntos
        private async void iconButton1_Click(object sender, EventArgs e)
        {
            // Mostrar un cuadro de confirmación antes de continuar
            DialogResult result = MessageBox.Show(
                "Usar puntos de cliente, no se podrá deshacer esta acción. ¿Desea continuar?",
                "Confirmación",
                MessageBoxButtons.YesNo,
                MessageBoxIcon.Warning
            );

            // Si el usuario elige "No", detener la ejecución
            if (result == DialogResult.No)
            {
                return;
            }

            if (txtClientePuntos.Text == "")
            {
                cbPorcentaje.Enabled = true;
                return;
            }
            else if (decimal.Parse(txtClientePuntos.Text) > 0)
            {
                decimal puntos = decimal.Parse(txtClientePuntos.Text);
                decimal totalPagar = decimal.Parse(txttotalpagar.Text);

                if (puntos >= totalPagar)
                {
                    // Si los puntos son mayores o iguales al total a pagar, dejar total en 0
                    puntos -= totalPagar; // Restar el total a pagar de los puntos
                    txttotalpagar.Text = "0";
                    txtClientePuntos.Text = puntos.ToString(); // Mostrar los puntos restantes
                }
                else
                {
                    // Si los puntos son menores al total, restarlos del total
                    decimal totalConPuntos = totalPagar - puntos;
                    txttotalpagar.Text = totalConPuntos.ToString();
                    txtClientePuntos.Text = "0"; // Usó todos los puntos, dejar en 0
                }

                cbPorcentaje.Enabled = false;

                // Llamar a la API para enviar el JSON con los puntos y el número de documento
                string documento = txtdocumentocliente.Text;
                string puntosRestantes = txtClientePuntos.Text;

                await EnviarDatosCliente(documento, puntosRestantes);
            }
        }

        // Método para enviar los datos a la API en formato JSON
        private async Task EnviarDatosCliente(string documento, string puntos)
        {
            try
            {
                // URL de la API (ajusta según sea necesario)
                string apiUrl = "https://software.bigcluboutlet.com/venta/api/actualizarpuntos.php";

                // Crear un objeto con los datos que vamos a enviar
                var data = new
                {
                    documento = documento,
                    puntos = puntos,
                    contrasena = "UlnItSYj4QDZvXMVOe8zXG0V4O6o11tpINmNZ6Ew2g3YRKdhzS"
                };

                // Serializar el objeto a JSON
                string jsonData = JsonConvert.SerializeObject(data);

                using (HttpClient client = new HttpClient())
                {
                    // Configurar el contenido de la solicitud HTTP
                    var content = new StringContent(jsonData, Encoding.UTF8, "application/json");

                    // Enviar la solicitud POST a la API
                    HttpResponseMessage response = await client.PostAsync(apiUrl, content);

                    if (response.IsSuccessStatusCode)
                    {
                        string responseString = await response.Content.ReadAsStringAsync();
                        MessageBox.Show("Datos enviados correctamente: " + responseString);
                    }
                    else
                    {
                        string errorResponse = await response.Content.ReadAsStringAsync();
                        MessageBox.Show("Error al enviar los datos: " + errorResponse);
                    }
                }
            }
            catch (Exception ex)
            {
                MessageBox.Show("Error: " + ex.Message);
            }
        }

