        private void editarCantidad(object sender, DataGridViewCellEventArgs e)
        {
            // Verifica si la celda editada es la columna de cantidad
            if (dgvdata.Columns[e.ColumnIndex].Name == "Cantidad")
            {
                int index = e.RowIndex;
                if (index >= 0)
                {
                    // Obtener el precio por unidad del producto
                    decimal precioUnitario = Convert.ToDecimal(dgvdata.Rows[index].Cells["Precio"].Value.ToString());
                    // Obtener la nueva cantidad ingresada
                    int nuevaCantidad = Convert.ToInt32(dgvdata.Rows[index].Cells["Cantidad"].Value.ToString());

                    // Calcular el nuevo subtotal
                    decimal nuevoSubtotal = precioUnitario * nuevaCantidad;
                    dgvdata.Rows[index].Cells["SubTotal"].Value = nuevoSubtotal;

                    // Recalcular el total
                    calcularTotal();
                }
            }
        }
